import React from "react";
import "./ExpenseDate.css";

const ExpenseDate = (props) => {
  return (
    <div>
      <div className="d-block m-2 date pe-3 ">
        <div className="fw-bold">{props.items.date}</div>
      </div>
    </div>
  );
};

export default ExpenseDate;
